    const loadPetData = async() => {
        const response = await fetch("localhost:8080/pets");
        const petJsonData = await response.json();
        console.log(petJsonData);
    }

    useEffect(() =>{
        loadPetData();
    },[]) 


    return ( 
        <>
        <header>
        <h1>My Pets</h1>
        <AddPetForm />
        </header>
        <main>
            <PetList/>
        </main>


       </>
     );
}

export default PetContainer;
